import React from 'react';
import '../styles/About.css';

const About = () => {
  return (
    <div className="about-container">
      <h1 className="about-title">About Echoes of Culture</h1>
      <p className="about-description">
        Echoes of Culture aims to preserve and celebrate the unique heritage of tribes and endangered languages around the world. 
        We strive to provide a platform to learn, share, and contribute to cultural preservation efforts.
      </p>
      <p className="about-mission">
        Our mission is to bridge the gap between modern technology and ancient traditions, ensuring that cultural knowledge is 
        not only documented but also appreciated.
      </p>
    </div>
  );
};

export default About;
